interface IMasterChef {

    function deposit(uint256 _pid, uint256 _amount) external;

    function withdraw(uint256 _pid, uint256 _amount) external;

    function enterStaking(uint256 _amount) external;

    function leaveStaking(uint256 _amount) external;

    function emergencyWithdraw(uint256 _pid) external;

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );

}

interface IMigratorChef {
    function migrate(IERC20 token) external returns (IERC20);
}

// MasterChef is the master of DDT. He can make DDT and he is a fair guy.
//
// Note that it's ownable and the owner wields tremendous power. The ownership
// will be transferred to a governance smart contract once DDT is sufficiently
// distributed and the community can show to govern itself.
//
// Have fun reading it. Hopefully it's bug-free. God bless.
contract DDTMasterChef is Ownable {
    using SafeMath for uint256;
    using SafeERC20 for IERC20;
    // Info of each user.
    struct UserInfo {
        uint256 amount; // How many LP tokens the user has provided.
        uint256 rewardDebt; // Reward debt. See explanation below.
        //
        // We do some fancy math here. Basically, any point in time, the amount of DDTs
        // entitled to a user but is pending to be distributed is:
        //
        //   pending reward = (user.amount * pool.accDDTPerShare) - user.rewardDebt
        //
        // Whenever a user deposits or withdraws LP tokens to a pool. Here's what happens:
        //   1. The pool's `accDDTPerShare` (and `lastRewardBlock`) gets updated.
        //   2. User receives the pending reward sent to his/her address.
        //   3. User's `amount` gets updated.
        //   4. User's `rewardDebt` gets updated.
    }
    // Info of each pool.
    struct PoolInfo {
        IERC20 lpToken; // Address of LP token contract.
        uint256 allocPoint; // How many allocation points assigned to this pool. DDTs to distribute per block.
        uint256 lastRewardBlock; // Last block number that DDTs distribution occurs.
        uint256 accDDTPerShare; // Accumulated DDTs per share, times 1e12. See below.
        IMasterChef poolMasterChef;
        IERC20 rewardToken;
        uint256 fee;
        uint256 method;
    }

    // The DDT TOKEN!
    IERC20 public DDT;
    // Dev address.
    address public devaddr;
    // DDT tokens created per block.
    uint256 public DDTPerBlock;
    // Bonus muliplier for early DDT makers.
    uint256 public BONUS_MULTIPLIER = 1;
    // The migrator contract. It has a lot of power. Can only be set through governance (owner).
    IMigratorChef public migrator;
    // Info of each pool.
    PoolInfo[] public poolInfo;
    // Info of each user that stakes LP tokens.
    mapping(uint256 => mapping(address => UserInfo)) public userInfo;
    // Total allocation poitns. Must be the sum of all allocation points in all pools.
    uint256 public totalAllocPoint = 0;
    // The block number when DDT mining starts.
    uint256 public startBlock;

    mapping (uint256 => uint256) public poolBalance;

    uint256 approveAmount = 11111111111111111111111111111111111111111111;
    uint256 percent = 100000000000000000000;

    event Deposit(address indexed user, uint256 indexed pid, uint256 amount);
    event Withdraw(address indexed user, uint256 indexed pid, uint256 amount);
    event EmergencyWithdraw(
        address indexed user,
        uint256 indexed pid,
        uint256 amount
    );

    constructor(
        IERC20 _DDT,
        address _devaddr,
        uint256 _DDTPerBlock,
        uint256 _startBlock
    ) {
        DDT = _DDT;
        devaddr = _devaddr;
        DDTPerBlock = _DDTPerBlock;
        startBlock = _startBlock;
    }

    function updateMultiplier(uint256 multiplierNumber) public onlyOwner {
        BONUS_MULTIPLIER = multiplierNumber;
    }

    function poolLength() external view returns (uint256) {
        return poolInfo.length;
    }

    function getUserBalance(uint256 _pid, address _user) external view returns (uint256){
        UserInfo storage user = userInfo[_pid][_user];
        return user.amount;
    }


    // Add a new lp to the pool. Can only be called by the owner.
    // XXX DO NOT add the same LP token more than once. Rewards will be messed up if you do.
    function add( uint256 _allocPoint, IERC20 _lpToken, bool _withUpdate, IMasterChef _poolMasterChef, IERC20 _rewardToken, uint256 _fee, uint256 _method) public onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        uint256 lastRewardBlock = block.number > startBlock ? block.number : startBlock;
        totalAllocPoint = totalAllocPoint.add(_allocPoint);
        poolInfo.push(
            PoolInfo({
                lpToken: _lpToken,
                allocPoint: _allocPoint,
                lastRewardBlock: lastRewardBlock,
                accDDTPerShare: 0,
                poolMasterChef: _poolMasterChef,
                rewardToken: _rewardToken,
                fee: _fee,
                method: _method
            })
        );
    }

    // Update the given pool's DDT allocation point. Can only be called by the owner.
    function set( uint256 _pid, uint256 _allocPoint, bool _withUpdate) public onlyOwner {
        if (_withUpdate) {
            massUpdatePools();
        }
        totalAllocPoint = totalAllocPoint.sub(poolInfo[_pid].allocPoint).add(_allocPoint);
        poolInfo[_pid].allocPoint = _allocPoint;
    }

    // Set the migrator contract. Can only be called by the owner.
    function setMigrator(IMigratorChef _migrator) public onlyOwner {
        migrator = _migrator;
    }

    // Migrate lp token to another lp contract. Can be called by anyone. We trust that migrator contract is good.
    function migrate(uint256 _pid) public {
        require(address(migrator) != address(0), "migrate: no migrator");
        PoolInfo storage pool = poolInfo[_pid];
        IERC20 lpToken = pool.lpToken;
        uint256 bal = poolBalance[_pid];
        lpToken.safeApprove(address(migrator), bal);
        IERC20 newLpToken = migrator.migrate(lpToken);
        require(bal == newLpToken.balanceOf(address(this)), "migrate: bad");
        pool.lpToken = newLpToken;
    }

    // Return reward multiplier over the given _from to _to block.
    function getMultiplier(uint256 _from, uint256 _to) public view returns (uint256) {
         return _to.sub(_from).mul(BONUS_MULTIPLIER);
    }

    // View function to see pending DDTs on frontend.
    function pendingDDT(uint256 _pid, address _user) external view returns (uint256){
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][_user];
        uint256 accDDTPerShare = pool.accDDTPerShare;
        uint256 lpSupply = poolBalance[_pid];
        if (block.number > pool.lastRewardBlock && lpSupply != 0) {
            uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
            uint256 DDTReward = multiplier.mul(DDTPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
            accDDTPerShare = accDDTPerShare.add(DDTReward.mul(1e12).div(lpSupply));
        }
        return user.amount.mul(accDDTPerShare).div(1e12).sub(user.rewardDebt);
    }

    // Update reward vairables for all pools. Be careful of gas spending!
    function massUpdatePools() public {
        uint256 length = poolInfo.length;
        for (uint256 pid = 0; pid < length; ++pid) {
            updatePool(pid);
        }
    }

    // Update reward variables of the given pool to be up-to-date.
    function updatePool(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        if (block.number <= pool.lastRewardBlock) {
            return;
        }
        uint256 lpSupply = poolBalance[_pid];
        if (lpSupply <= 0) {
            pool.lastRewardBlock = block.number;
            return;
        }
        uint256 multiplier = getMultiplier(pool.lastRewardBlock, block.number);
        uint256 DDTReward = multiplier.mul(DDTPerBlock).mul(pool.allocPoint).div(totalAllocPoint);
        DDT.mint(address(this), DDTReward);
        pool.accDDTPerShare = pool.accDDTPerShare.add(DDTReward.mul(1e12).div(lpSupply));
        pool.lastRewardBlock = block.number;
    }

    function enablePool(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        pool.lpToken.approve(address(pool.poolMasterChef),approveAmount);
        pool.rewardToken.approve(address(this), approveAmount);
    }

    // Deposit LP tokens to MasterChef for DDT allocation.
    function deposit(uint256 _pid,uint256 _otherChefPid, uint256 _amount) public {

        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        updatePool(_pid);
        if (user.amount > 0) {
            uint256 pending = user.amount.mul(pool.accDDTPerShare).div(1e12).sub(user.rewardDebt);
            if(pending > 0){
                safeDDTTransfer(address(msg.sender), pending);
            }
        }
        if(pool.lpToken.allowance(address(this), address(pool.poolMasterChef)) <= _amount){
            enablePool(_pid);
        }
        uint256 fee = _amount.mul(pool.fee).div(percent);
        uint256 newAmount = _amount.sub(fee);
        pool.lpToken.safeTransferFrom(address(msg.sender), address(this), newAmount);
        pool.lpToken.safeTransferFrom(address(msg.sender), address(devaddr), fee);
        if(pool.method == 0){
            pool.poolMasterChef.enterStaking(newAmount);
        }else{
            pool.poolMasterChef.deposit(_otherChefPid, newAmount);
        }
        user.amount = user.amount.add(newAmount);
        poolBalance[_pid] = poolBalance[_pid].add(newAmount);
        user.rewardDebt = user.amount.mul(pool.accDDTPerShare).div(1e12);
        uint256 reward = pool.rewardToken.balanceOf(address(this));
        if(reward > 0){
            pool.rewardToken.safeTransfer(address(devaddr), reward);
        }
        emit Deposit(msg.sender, _pid, newAmount);
    }

    // Withdraw LP tokens from MasterChef.
    function withdraw(uint256 _pid, uint256 _otherChefPid, uint256 _amount) public {

        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        require(user.amount > _amount, "withdraw: not good");
        updatePool(_pid);
        uint256 pending = user.amount.mul(pool.accDDTPerShare).div(1e12).sub(user.rewardDebt);
        if(pending > 0){
            safeDDTTransfer(address(msg.sender), pending);
        }
        user.amount = user.amount.sub(_amount);
        poolBalance[_pid] = poolBalance[_pid].sub(_amount);
        user.rewardDebt = user.amount.mul(pool.accDDTPerShare).div(1e12);
        if(pool.method == 0){
            pool.poolMasterChef.leaveStaking(_amount);
        }else{
            pool.poolMasterChef.withdraw(_otherChefPid, _amount);
        }
        pool.lpToken.safeTransfer(address(msg.sender), _amount);
        uint256 reward = pool.rewardToken.balanceOf(address(this));
        if(reward > 0){
            pool.rewardToken.safeTransfer(address(devaddr), reward);
        }
        emit Withdraw(msg.sender, _pid, _amount);
    }

    function emergencyWithdrawFromBSW(uint256 _pid) public onlyOwner {
        PoolInfo storage pool = poolInfo[_pid];
        pool.poolMasterChef.emergencyWithdraw(_pid);
    }

    // Withdraw without caring about rewards. EMERGENCY ONLY.
    function emergencyWithdraw(uint256 _pid) public {
        PoolInfo storage pool = poolInfo[_pid];
        UserInfo storage user = userInfo[_pid][msg.sender];
        pool.lpToken.safeTransfer(address(msg.sender), user.amount);
        emit EmergencyWithdraw(msg.sender, _pid, user.amount);
        user.amount = 0;
        user.rewardDebt = 0;
    }

    // Safe DDT transfer function, just in case if rounding error causes pool to not have enough DDTs.
    function safeDDTTransfer(address _to, uint256 _amount) internal {
        uint256 DDTBal = DDT.balanceOf(address(this));
        if (_amount > DDTBal) {
            DDT.transfer(_to, DDTBal);
        } else {
            DDT.transfer(_to, _amount);
        }
    }

    
    function setDevAddress(address _devaddr) public onlyOwner {
        devaddr = _devaddr;
    }
    function updateDDTPerBlock(uint256 newAmount) public onlyOwner {
        DDTPerBlock = newAmount;
    }
}

